import React from 'react'
import Box from '@mui/material/Box'

function InputDisplay({type, value, name}) {
    return (
        <div>
            <Box>
                Name: {name}
                Value: {value}
                Type: {type}
            </Box>
            
        </div>
    )
}


export default InputDisplay
